function PrepareMarkers(){
	mapData = loadDatas();
	
	//======================================
	var objects = getFlags();
	var id = 1;
	objects.forEach(object => {
		flags.push({
			id:"flag-"+id,
			description:object.properties.map_poi,
			position:{x:object.geometry.coordinates[0],y:object.geometry.coordinates[1]},
			img:"images/markers/"+object.properties.icon_url,
			type:"flags",
			isShow:isHidden("flag-"+id),
			shape:"point"
		});
		id++;
	});
	
	//========================================
	objects = getLocations();
	id = 1;
	objects.forEach(object => {
		var imageName = "Unknown.png";
		
		if(object.properties.icon_url != null && object.properties.icon_url != undefined){
			imageName = object.properties.icon_url.split('/').pop();
		}
		
		var idName = "location";
		
		if (object.properties.map_poi.includes('(Quest)')) {
			idName = "quest"
		}
		
		locations.push({
			id:idName+"-"+id,
			description:object.properties.map_poi,
			position:{x:object.geometry.coordinates[0],y:object.geometry.coordinates[1]},
			img:"images/markers/"+imageName,
			type:idName+"s",
			isShow:isHidden(idName+"-"+id),
			shape:"point"
		});
		id++;
	});
	
	//==================================================
	objects = getElexirs();
	id = 1;
	objects.forEach(object => {
		elexirs.push({
			id:"elexir-"+id,
			description:object.properties.map_poi,
			position:{x:object.geometry.coordinates[0],y:object.geometry.coordinates[1]},
			img:"images/markers/VigorElixir.png",
			type:"elexirs",
			isShow:isHidden("elexir-"+id),
			shape:"point"
		});
		id++;
	});
	
	//==================================================
	objects = getBosses();
	id = 1;
	objects.forEach(object => {
		bosses.push({
			id:"boss-"+id,
			description:object.properties.map_poi,
			position:{x:object.geometry.coordinates[0],y:object.geometry.coordinates[1]},
			img:"images/markers/boss.png",
			type:"bosses",
			isShow:isHidden("boss-"+id),
			shape:"point"
		});
		id++;
	});
	
	//==================================================
	objects = getSomberseason();
	id = 1;
	objects.forEach(object => {
		somberseasons.push({
			id:"somberseason-"+id,
			description:object.properties.map_poi,
			position:{x:object.geometry.coordinates[0],y:object.geometry.coordinates[1]},
			img:"images/markers/somberseason.png",
			type:"somberseasons",
			isShow:isHidden("somberseason-"+id),
			shape:"point"
		});
		id++;
	});
	
	//==================================================
	objects = getResources();
	id = 1;
	objects.forEach(object => {
		var imageName = "Unknown.png";
		
		if(object.properties.icon_url != null && object.properties.icon_url != undefined){
			imageName = object.properties.icon_url.split('/').pop();
		}
		
		if(object.geometry == undefined || object.geometry.coordinates == undefined){
			console.log(object.properties.map_poi);
		}else{
			resources.push({
				id:"resource-"+id,
				description:object.properties.map_poi,
				position:{x:object.geometry.coordinates[0],y:object.geometry.coordinates[1]},
				img:"images/markers/"+imageName,
				type:"resources",
				isShow:isHidden("resource-"+id),
				shape:"point"
			});
			id++;
		}
	});
	
	//==================================================
	objects = getRegions();
	id = 1;
	objects.forEach(object => {
		regions.push({
			id:"region-"+id,
			description:object.properties.map_poi,
			position:object.geometry.coordinates[0],
			img:"",
			type:"regions",
			isShow:isHidden("region-"+id),
			shape:"polygon"
		});
		id++;
	});
}

function PrepareReceipts(){
	var objects = getRecipies();
	var id = 1;
	objects.forEach(object => {
		var description = "";
		if(object.npc!=""){
			description+="<b>NPC:</b> " + object.npc;
		}
		if(object.price!=""){
			description+=" <b>Price:</b> " + object.price;
		}
		if(object.building!=""){
			description+=" <b>Building:</b> " + object.building;
		}
		if(object.slot!=""){
			description+=" <b>Slot:</b> " + object.slot;
		}
		if(object.weapon!=""){
			description+=" <b>Weapon:</b> " + object.weapon;
		}
		
		if(object.location!=undefined && object.location!=""){
			var location="";
			if(object.position!=undefined && object.position!=null){
				location = '<a href="#" onclick="showMark('+object.position.x+','+object.position.y+'); return false;">'+object.location+'</a>';
			}
			
			receipts.push({
				id:"receipt-"+id,
				name:object.book,
				description:description,
				loc:location,
				position:object.position,
				reputation:object.reputation,
				type:"receipts",
				isShow:isHidden("receipt-"+id),
			});
			id++;
		}
	});
}

function saveDatas(){
	localStorage.setItem('mapData', JSON.stringify(mapData));
}

function loadDatas(){
	var savedDatas = JSON.parse(localStorage.getItem('mapData'));
	if(savedDatas == null || savedDatas == undefined){
		saveDatas();
		savedDatas = mapData;
	}
	return savedDatas;
}

function isHidden(id){
	for (const item of mapData.hidenMarkers) {
		if (item == id) {
			return false;
		}
	}
	
	return true;
}

